measurements.description:
Two well-displayed flowers on one pendent inflorescence; 

	sepals and petals reflexted, alate, green-yellow, heavily spotted cordovan;


lip bucket-shaped, green-yellow, heavily spotted cordovan exterior and interior, hypochile globulous, yellow-orange distally, spotted cordovan, 
mesochile ridged, yellow-orange, heavily overlaid cordovan; column cordovan;
substance firm, lip hard; texture waxy, lateral sepals matte.
